import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminOrders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchOrders = async () => {
      try {
        const res = await axios.get("http://localhost:3001/api/adminorders");
        if (res.status === 200) {
          setOrders(res.data.orders);
        } else {
          setError("Failed to fetch orders.");
        }
      } catch (err) {
        setError("An error occurred while fetching orders.");
      } finally {
        setLoading(false);
      }
    };

    fetchOrders();
  }, []);

  if (loading) {
    return (
      <div className="d-flex justify-content-center align-items-center py-5">
        <div className="spinner-border text-primary"></div>
        <span className="ms-2">Loading orders...</span>
      </div>
    );
  }

  if (error) {
    return <p className="text-center text-danger mt-5">{error}</p>;
  }

  return (
    <section className="py-4">
      <h2 className="fw-bold text-center mb-4">Admin Orders</h2>

      {orders.length === 0 ? (
        <p className="text-center text-muted fs-5">No orders found.</p>
      ) : (
        <div className="container">
          <div className="d-flex flex-column gap-4">
            {orders.map((order) => (
              <div key={order.id} className="card shadow-sm border-0">

                {/* ðŸ”¹ HEADER */}
                <div className="card-header bg-white d-flex flex-column flex-md-row justify-content-between gap-2">
                  <div>
                    <div className="fw-bold">
                      Order ID: <span className="text-primary">{order.id}</span>
                    </div>
                    <small className="text-muted">
                      {order.customer_name} Â· {order.customer_email}
                    </small>
                  </div>

                  <div className="d-flex align-items-center gap-2">
                    <span
                      className={`badge ${order.paymentStatus === "Paid"
                          ? "bg-success"
                          : "bg-warning text-dark"
                        }`}
                    >
                      {order.paymentStatus}
                    </span>

                    <span
                      className={`badge ${order.status === "Confirmed"
                          ? "bg-success"
                          : order.status === "Shipped"
                            ? "bg-info text-dark"
                            : order.status === "Delivered"
                              ? "bg-primary"
                              : "bg-secondary"
                        }`}
                    >
                      {order.status}
                    </span>
                  </div>
                </div>

                {/* ðŸ”¹ PRODUCTS */}
                <div className="card-body p-0">
                  {order.products.map((p, i) => (
                    <div
                      key={i}
                      className="d-flex align-items-center px-4 py-3 border-bottom"
                    >
                      <img
                        src={`http://localhost:3001/uploads/${p.image}`}
                        alt={p.product_name}
                        className="rounded me-3"
                        style={{
                          width: "60px",
                          height: "60px",
                          objectFit: "cover",
                        }}
                        onError={(e) =>
                          (e.target.src = "/default-product.png")
                        }
                      />

                      <div className="flex-grow-1">
                        <div className="fw-semibold">{p.product_name}</div>
                        <small className="text-muted">
                          â‚¹{p.price} Ã— {p.qty}
                        </small>
                      </div>

                      <div className="fw-bold text-success">
                        â‚¹{p.total.toFixed(2)}
                      </div>
                    </div>
                  ))}
                </div>

                {/* ðŸ”¹ FOOTER */}
                <div className="card-footer bg-white d-flex flex-column flex-md-row justify-content-between align-items-center gap-2">
                  <small className="text-muted">
                    Ordered on{" "}
                    {new Date(order.orderDate).toLocaleString("en-IN", {
                      dateStyle: "medium",
                      timeStyle: "short",
                    })}
                  </small>

                  <div className="fw-bold fs-6 text-success">
                    Total: â‚¹{order.totalAmount.toFixed(2)}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </section>
  );
};

export default AdminOrders;
